import styled from 'styled-components';

const EmptyLinksListWrapper = styled.div`
  margin-bottom: 0.1rem;
  padding: 0.8rem 0 0.7rem 2rem;
  line-height: 18px;
`;

export default EmptyLinksListWrapper;
